CREATE USER IF NOT EXISTS SA PASSWORD '' ADMIN;
CREATE SCHEMA IF NOT EXISTS PS_COMMON AUTHORIZATION SA;
CREATE SCHEMA IF NOT EXISTS PS_LOGBOOK AUTHORIZATION SA;
CREATE SCHEMA IF NOT EXISTS PS_OBSERVATION AUTHORIZATION SA;
CREATE SCHEMA IF NOT EXISTS COMMON AUTHORIZATION SA;
CREATE SCHEMA IF NOT EXISTS PS_LANDING AUTHORIZATION SA;
CREATE SCHEMA IF NOT EXISTS PS_LOCALMARKET AUTHORIZATION SA;
CREATE CACHED TABLE COMMON.COUNTRY
(
    TOPIAID         VARCHAR(255)                          NOT NULL,
    TOPIAVERSION    BIGINT                                NOT NULL,
    TOPIACREATEDATE TIMESTAMP                             NOT NULL,
    LASTUPDATEDATE  TIMESTAMP DEFAULT CURRENT_TIMESTAMP() NOT NULL,
    CODE            VARCHAR(255)                          NOT NULL,
    URI             VARCHAR(255),
    HOMEID          VARCHAR(255),
    NEEDCOMMENT     BOOLEAN   DEFAULT FALSE               NOT NULL,
    STATUS          INTEGER                               NOT NULL,
    LABEL1          VARCHAR(255)                          NOT NULL,
    LABEL2          VARCHAR(255)                          NOT NULL,
    LABEL3          VARCHAR(255)                          NOT NULL,
    LABEL4          VARCHAR(255),
    LABEL5          VARCHAR(255),
    LABEL6          VARCHAR(255),
    LABEL7          VARCHAR(255),
    LABEL8          VARCHAR(255),
    ISO2CODE        VARCHAR(255)                          NOT NULL,
    ISO3CODE        VARCHAR(255)                          NOT NULL
);
ALTER TABLE COMMON.COUNTRY
    ADD CONSTRAINT COMMON.CONSTRAINT_6 PRIMARY KEY (TOPIAID);
