CREATE INDEX COMMON.IDX_COMMON_SIZEMEASURETYPE_LASTUPDATEDATE ON COMMON.SIZEMEASURETYPE (LASTUPDATEDATE);
CREATE CACHED TABLE COMMON.SPECIES
(
    TOPIAID           VARCHAR(255)                          NOT NULL,
    TOPIAVERSION      BIGINT                                NOT NULL,
    TOPIACREATEDATE   TIMESTAMP                             NOT NULL,
    LASTUPDATEDATE    TIMESTAMP DEFAULT CURRENT_TIMESTAMP() NOT NULL,
    CODE              VARCHAR(255),
    URI               VARCHAR(255),
    HOMEID            VARCHAR(255),
    NEEDCOMMENT       BOOLEAN   DEFAULT FALSE               NOT NULL,
    STATUS            INTEGER                               NOT NULL,
    LABEL1            VARCHAR(255)                          NOT NULL,
    LABEL2            VARCHAR(255)                          NOT NULL,
    LABEL3            VARCHAR(255)                          NOT NULL,
    LABEL4            VARCHAR(255),
    LABEL5            VARCHAR(255),
    LABEL6            VARCHAR(255),
    LABEL7            VARCHAR(255),
    LABEL8            VARCHAR(255),
    SPECIESGROUP      VARCHAR(255)                          NOT NULL,
    FAOCODE           VARCHAR(255),
    SCIENTIFICLABEL   VARCHAR(255)                          NOT NULL,
    WORMSID           BIGINT,
    MINLENGTH         NUMERIC,
    MAXLENGTH         NUMERIC,
    MINWEIGHT         NUMERIC,
    MAXWEIGHT         NUMERIC,
    SIZEMEASURETYPE   VARCHAR(255),
    WEIGHTMEASURETYPE VARCHAR(255)
);
ALTER TABLE COMMON.SPECIES
    ADD CONSTRAINT COMMON.CONSTRAINT_B PRIMARY KEY (TOPIAID);
